const validateCCCD = (cccd) => {
    return !!(cccd.Name &&
        cccd.Id &&
        cccd.Id.length === 12 &&
        cccd.NgaySinh &&
        cccd.DiaChi &&
        cccd.gioiTinh &&
        cccd.maBuuGui);
};
// Export all in one function for easy testing
const generateAndValidateCCCDList = (count = 50) => {
    const list = generateCCCDList(count);
    return list.filter(validateCCCD);
};


